// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract DataStorage {
    struct KYCData {
        string nin;
        string bvn;
        string passport;
        string publicKey;
    }

    mapping(address => KYCData) private kycRecords;

    event DataStored(address indexed user, string nin, string bvn, string passport, string publicKey);

    // Store KYC Data
    function storeData(string memory _nin, string memory _bvn, string memory _passport, string memory _publicKey) public {
        KYCData memory newRecord = KYCData({
            nin: _nin,
            bvn: _bvn,
            passport: _passport,
            publicKey: _publicKey
        });

        kycRecords[msg.sender] = newRecord;
        emit DataStored(msg.sender, _nin, _bvn, _passport, _publicKey);
    }

    // Retrieve KYC Data
    function retrieveData() public view returns (string memory nin, string memory bvn, string memory passport, string memory publicKey) {
        KYCData memory record = kycRecords[msg.sender];
        return (record.nin, record.bvn, record.passport, record.publicKey);
    }
}
